class Solution {
    public int findMaxConsecutiveOnes(int[] nums) {
        
        int len = nums.length;
        if(len == 0){
            return 0;
        }
        if(len == 1){
            if(nums[0] == 1){
                return 1;
            }else{
                return 0;
            }
        }
        int maxlength = 0;
        for(int i = 0 ; i < len;){
            if(nums[i] == 0){
                i++;
                continue;
            }
            Stack<Integer> numsStack = new Stack<>();
            numsStack.push(nums[i]);
            
            for(int j = i+1; j < len; j++){
                if(nums[j] == nums[i]){
                    numsStack.push(nums[j]);
                }else{
                    
                    break;
                }
            }
            if(maxlength < numsStack.size()){
                maxlength = numsStack.size();
            }
            i += numsStack.size();
        }
        
        return maxlength;
    }
}

